import React, { Component } from 'react';
import "../styles/presentacion.css";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from 'react-responsive-carousel';
import Pagina1 from "../assets/PRESENTACION_1_Partidos_Politicos.png";
import Pagina2 from "../assets/Pag2_PRESENTACION_1.png";
import Pagina3 from "../assets/Pag3_PRESENTACION_1.png";
import Pagina4 from "../assets/Pag4_PRESENTACION_1.png";
import Pagina5 from "../assets/Pag5_PRESENTACION_1.png";
import Pagina6 from "../assets/Pag6_PRESENTACION_1.png";
import Pagina7 from "../assets/Pag6_PRESENTACION_1.png";

class Presentacion1 extends Component {
    render() {
        return (
          <div className="contenedor_carrousel">
            <h1>Partidos Políticos</h1>
            <Carousel
              className="crsl"
              autoPlay
              infiniteLoop
              centerMode
              interval={5000}
            >
                <div>
                    <img src={Pagina1} alt='Portada'/>
                </div>
                <div>
                    <img src={Pagina2} alt='Descripcion' />
                </div>
                <div>
                    <img src={Pagina3} alt='Investigacion de usuario' />
                </div>
                <div>
                    <img src={Pagina4} alt='Persona ficticia 1' />
                </div>
                <div>
                    <img src={Pagina5} alt='Persona ficticia 2' />
                </div>
                <div>
                    <img src={Pagina6} alt='Mapa de viaje del usuario' />
                </div>
            </Carousel>
          </div>
        );
    }
};

export default Presentacion1;

